const numbers = input.split('\n').map(Number);

function moduloEuclidian(op1, op2) {
  return ((op1 % op2) + op2) % op2;
}

const numbersData = [];
for (const [id, n] of numbers.entries()) {
  numbersData.push({
    value: n,
    moves: n,
    pos: id,
  });
}

function getNextPos(curr) {
  const next = moduloEuclidian(curr.pos + curr.moves, numbersData.length - 1);
  if (curr.value >= 0) return next;
  return next === 0 ? numbersData.length - 1 : next;
}

function mix() {
  for (let i = 0; i < numbersData.length;  i++) {
    const curr = numbersData[i];
    const currPos = curr.pos;
    const nextPos = getNextPos(curr);
    if (currPos === nextPos) continue;

    const min = Math.min(currPos, nextPos);
    const max = Math.max(currPos, nextPos);

    for (let j = 0; j < numbersData.length;  j++) {
      const next = numbersData[j];
      if (i === j) {
        curr.pos = nextPos;
      } else if (next.pos <= max && next.pos >= min) {
        next.pos += Math.sign(currPos - nextPos);
      }
    }
  }
}

// part 1
mix();
let sorted = [...numbersData.values()].sort((a, b) => a.pos - b.pos).map(n => n.value);
let zeroIndex = sorted.indexOf(0);
let sum = 0;
sum += sorted[moduloEuclidian(zeroIndex + 1000, sorted.length)];
sum += sorted[moduloEuclidian(zeroIndex + 2000, sorted.length)];
sum += sorted[moduloEuclidian(zeroIndex + 3000, sorted.length)];
console.log(sum);

